@Component({
  selector: 'app-footer',
  templateUrl: './footer.component.html',
  styleUrls: ['./footer.component.css']
})
export class FooterComponent {
  email:string = "reale@mat.unical.it"
  tel:string = "12345678"
}
<footer>
    <div class="container">
    Contatti: {{email}}
    Tel: {{tel}}
    Privacy Policy
    Facebook
    </div>
</footer>
